import React, { useState, useEffect } from 'react';
import {
  Box,
  Card,
  TableContainer,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Typography,
  Paper,
  Chip,
  Button,
  Stack,
} from '@mui/material';

// Dữ liệu mẫu cho đơn hàng
const mockOrders = [
  {
    id: 1,
    orderStatus: 'Chưa giải quyết',
    createAt: '2024-12-28T17:11:21.092+00:00',
    paymentType: 0,
    statusPayment: 0,
    totalItem: 2,
    totalPrice: 500000,
  },
  {
    id: 2,
    orderStatus: 'Đang giao hàng',
    createAt: '2024-12-29T10:20:00.000+00:00',
    paymentType: 1,
    statusPayment: 1,
    totalItem: 3,
    totalPrice: 750000,
  },
  {
    id: 3,
    orderStatus: 'Đã hoàn thành',
    createAt: '2024-12-30T14:45:00.000+00:00',
    paymentType: 2,
    statusPayment: 1,
    totalItem: 1,
    totalPrice: 200000,
  },
  {
    id: 4,
    orderStatus: 'Chưa giải quyết',
    createAt: '2025-01-01T08:15:00.000+00:00',
    paymentType: 0,
    statusPayment: 0,
    totalItem: 4,
    totalPrice: 1000000,
  },
  {
    id: 5,
    orderStatus: 'Đã giao hàng',
    createAt: '2025-01-02T09:30:00.000+00:00',
    paymentType: 1,
    statusPayment: 1,
    totalItem: 2,
    totalPrice: 500000,
  },
];

// Map paymentType và statusPayment sang text
const paymentTypes = ['Tiền mặt', 'Chuyển khoản', 'Thẻ tín dụng'];
const paymentStatuses = ['Chưa thanh toán', 'Đã thanh toán'];

const Orders = () => {
  // State cho dữ liệu và phân trang
  const [orders, setOrders] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const rowsPerPage = 2; // Mỗi trang hiển thị 2 đơn hàng

  const totalPages = Math.ceil(mockOrders.length / rowsPerPage);

  useEffect(() => {
    // Giả lập fetch API theo trang
    const fetchOrders = () => {
      const start = (currentPage - 1) * rowsPerPage;
      const end = start + rowsPerPage;
      setOrders(mockOrders.slice(start, end));
    };

    fetchOrders();
  }, [currentPage]);

  // Chuyển trang
  const handlePageChange = (page) => {
    if (page >= 1 && page <= totalPages) {
      setCurrentPage(page);
    }
  };

  return (
    <Box p={3}>
      <Card>
        <Typography variant="h5" sx={{ p: 2 }}>
          Quản lý Đơn Hàng
        </Typography>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>#</TableCell>
                <TableCell>Trạng thái</TableCell>
                <TableCell>Ngày tạo</TableCell>
                <TableCell>Phương thức thanh toán</TableCell>
                <TableCell>Trạng thái thanh toán</TableCell>
                <TableCell>Tổng số món</TableCell>
                <TableCell>Tổng giá</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {orders.map((order) => (
                <TableRow key={order.id}>
                  <TableCell>{order.id}</TableCell>
                  <TableCell>
                    <Chip
                      label={order.orderStatus}
                      color={
                        order.orderStatus === 'Chưa giải quyết'
                          ? 'warning'
                          : order.orderStatus === 'Đang giao hàng'
                          ? 'primary'
                          : 'success'
                      }
                    />
                  </TableCell>
                  <TableCell>
                    {new Date(order.createAt).toLocaleString()}
                  </TableCell>
                  <TableCell>{paymentTypes[order.paymentType]}</TableCell>
                  <TableCell>{paymentStatuses[order.statusPayment]}</TableCell>
                  <TableCell>{order.totalItem}</TableCell>
                  <TableCell>
                    {order.totalPrice.toLocaleString()} VND
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>

        {/* Phân trang đơn giản */}
        <Stack direction="row" justifyContent="center" alignItems="center" spacing={1} p={2}>
          <Button
            variant="contained"
            onClick={() => handlePageChange(currentPage - 1)}
            disabled={currentPage === 1}
          >
            ←
          </Button>
          {Array.from({ length: totalPages }, (_, index) => (
            <Button
              key={index + 1}
              variant={currentPage === index + 1 ? 'contained' : 'outlined'}
              onClick={() => handlePageChange(index + 1)}
            >
              {index + 1}
            </Button>
          ))}
          <Button
            variant="contained"
            onClick={() => handlePageChange(currentPage + 1)}
            disabled={currentPage === totalPages}
          >
            →
          </Button>
        </Stack>
        <Typography align="center" sx={{ pb: 2 }}>
          Trang {currentPage} / {totalPages}
        </Typography>
      </Card>
    </Box>
  );
};

export default Orders;
